import CharCard from './CharCard';




export default class CharList extends Component {


    render(){
        return(
            <div className="row">           
                <div className='col-md-3 col-sm-6 mb-5'>
                <div className="card">
                    <div className="card-header">        
                        <h1>oi</h1>
                    </div>   
                </div>
                </div>
                <CharCard />
                <CharCard />
                <CharCard />
                <CharCard />
                <CharCard />
